import React, { useState } from 'react';
import Button from '@material-ui/core/Button';
import CssBaseline from '@material-ui/core/CssBaseline';
import Textfield from '@material-ui/core/TextField';
import Link from '@material-ui/core/Link';
import Grid from '@material-ui/core/Grid';
import Box from '@material-ui/core/Box';

import Typography from '@material-ui/core/Typography';
import { makeStyles } from '@material-ui/core/styles';
import Container from '@material-ui/core/Container';
import axios from 'axios';
import { useHistory } from 'react-router-dom';

const useStyles = makeStyles((theme) => ({
  paper: {
    marginTop: theme.spacing(0),
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
  },
  avatar: {
    marginTop: theme.spacing(8),
    backgroundColor: theme.palette.secondary.main,
  },
  form: {
    width: '100%', // Fix IE 11 issue.
    marginTop: theme.spacing(3),
    marginBottom: theme.spacing(5)
  },
  submit: {
    margin: theme.spacing(3, 0, 2),
  }
}));


function CreateFile() {
  const [identification, setIdentification] = useState();
  const [names, setNames] = useState();
  const [lastName, setLastName] = useState();
  const [description, setDescription] = useState();
  let history = useHistory();
  

  const Submit = (e) =>{
    e.preventDefault();
    axios.post("http://localhost:3001/registerFile", {identification, names, lastName, description})
    .then((response) => {
        // Manejar la respuesta o redirigir a una página de éxito
        console.log('Usuario creado:', response.data);
        // Puedes redirigir a una página de éxito o a donde necesites
        history.push('/Admin/FilePatient');
      })
      .catch((error) => {
        console.error(error);
      });
  };

  return (
    <div style={bgStyle}>
      <Container component="main" style={{ maxWidth: 600 }}>
        <CssBaseline />
        <div className={classes.paper}>
          <Avatar className={classes.avatar}></Avatar>
          <Typography component="h1" variant="h5" style={txtWhite}>
            Registrarse
          </Typography>

          <form onSubmit={handleSubmit} className={classes.form} noValidate>
            <Grid container spacing={2}>
              <Grid item xs={12}>
                <FormControl variant="filled" fullWidth style={tfStyle}>
                  <InputLabel id="identificationType-label">Seleccione tipo de Identificacion</InputLabel>
                  <Select
                    labelId="identificationType-label"
                    id="identificationType"
                    value={identificationType}
                    onChange={handleIdentificationTypeChange}
                    label="IdentificationType"
                  >
                    <MenuItem value="Fisica">Nacional</MenuItem>
                    <MenuItem value="Pasaporte">Pasaporte</MenuItem>
                    <MenuItem value="Documento Migratorio">Documento Migratorio</MenuItem>

                  </Select>
                </FormControl>
                {isSubmitting && !identificationType && (
                  <div style={{
                    textAlign: 'left',
                    color: '#f2a4a4',
                    fontSize: '15px',
                    fontWeight: 'normal',
                    borderRadius: '5px',
                    marginTop: '4px',
                    marginBottom: '4px',
                  }}>
                    <img src="https://cdn0.iconfinder.com/data/icons/shift-interfaces/32/Error-512.png" style={{
                      paddingTop: '1px',
                      paddingRight: '4px',
                      width: '15px',
                    }} />
                    {identificationTypeError}
                  </div>
                )}
              </Grid>
              <Grid item xs={12}>
                <Textfield
                  style={tfStyle}
                  variant="filled"
                  fullWidth
                  id="identification"
                  label="Número de Identificación"
                  onChange={(e) => {
                    const value = e.target.value;
                    setIdentification(value);
                    if (identificationRegex.test(value)) {
                      setIdentificationError(''); // Clear the error message
                    }
                  }}
                  name="identification"
                />
                {identificationError && (
                  <div style={{
                    textAlign: 'left',
                    color: '#f2a4a4',
                    fontSize: '15px',
                    fontWeight: 'normal',
                    borderRadius: '5px',
                    marginTop: '4px',
                    marginBottom: '4px',
                  }}>
                    <img src="https://cdn0.iconfinder.com/data/icons/shift-interfaces/32/Error-512.png" style={{
                      paddingTop: '1px',
                      paddingRight: '4px',
                      width: '15px',
                    }} />
                    {identificationError}
                  </div>
                )}
              </Grid>
              <Grid item xs={12} sm={6}>
                <TextField
                  style={tfStyle}
                  autoComplete="fname"
                  name="firstName"
                  variant="filled"
                  required
                  fullWidth
                  id="firstName"
                  label="Primer Nombre"
                  onChange={(e) => {
                    const value = e.target.value;
                    setName(value);
                    if (nameRegex.test(value)) {
                      setNameError(''); // Clear the error message
                    }
                  }}
                  autoFocus
                />
                {nameError && (
                  <div style={{
                    textAlign: 'left',
                    color: '#f2a4a4',
                    fontSize: '15px',
                    fontWeight: 'normal',
                    borderRadius: '5px',
                    marginTop: '4px',
                    marginBottom: '4px',
                  }}>
                    <img src="https://cdn0.iconfinder.com/data/icons/shift-interfaces/32/Error-512.png" style={{
                      paddingTop: '1px',
                      paddingRight: '4px',
                      width: '15px',
                    }} />
                    {nameError}
                  </div>
                )}
              </Grid>

              <Grid item xs={12} sm={6}>
                <TextField
                  style={tfStyle}
                  variant="filled"
                  required
                  fullWidth
                  id="lastName"
                  label="Apellido"
                  name="lastName"
                  onChange={(e) => {
                    const value = e.target.value;
                    setLastname(value);
                    if (lastnameRegex.test(value)) {
                      setLastnameError(''); // Clear the error message
                    }
                  }}
                  autoComplete="lname"
                />
                {lastnameError && (
                  <div style={{
                    textAlign: 'left',
                    color: '#f2a4a4',
                    fontSize: '15px',
                    fontWeight: 'normal',
                    borderRadius: '5px',
                    marginTop: '4px',
                    marginBottom: '4px',
                  }}>
                    <img src="https://cdn0.iconfinder.com/data/icons/shift-interfaces/32/Error-512.png" style={{
                      paddingTop: '1px',
                      paddingRight: '4px',
                      width: '15px',
                    }} />
                    {lastnameError}
                  </div>
                )}
              </Grid>

              <Grid item xs={12}>
                <TextField
                  style={tfStyle}
                  variant="filled"
                  required
                  fullWidth
                  id="email"
                  label="Correo"
                  name="email"
                  onChange={(e) => {
                    const value = e.target.value;
                    setEmail(value);
                    if (emailRegex.test(value)) {
                      setEmailError(''); // Clear the error message
                    }
                  }}
                  autoComplete="email"
                />
                {emailError && (
                  <div style={{
                    textAlign: 'left',
                    color: '#f2a4a4',
                    fontSize: '15px',
                    fontWeight: 'normal',
                    borderRadius: '5px',
                    marginTop: '4px',
                    marginBottom: '4px',
                  }}>
                    <img src="https://cdn0.iconfinder.com/data/icons/shift-interfaces/32/Error-512.png" style={{
                      paddingTop: '1px',
                      paddingRight: '4px',
                      width: '15px',
                    }} />
                    {emailError}
                  </div>
                )}
              </Grid>

              <Grid item xs={12}>
                <TextField
                  style={tfStyle}
                  variant="filled"
                  required
                  fullWidth
                  name="password"
                  label="Contraseña"
                  type="password"
                  id="password"
                  value={password}
                  onChange={(e) => {
                    const value = e.target.value;
                    setPassword(value);
                    if (value.length >= 8 && /[A-Za-z]/.test(value) && /\d/.test(value) && /[!@#$%^&*(),.?":{}|<>]/.test(value)) {
                      setPasswordError(''); // Borra el mensaje de error si la contraseña es válida
                    } else {
                      setPasswordError('La contraseña debe contener al menos 8 caracteres, una letra, un número y un carácter especial.');
                    }
                  }}
                  autoComplete="current-password"
                />
                {passwordError && (
                  <div style={{
                    textAlign: 'left',
                    color: '#f2a4a4',
                    fontSize: '15px',
                    fontWeight: 'normal',
                    borderRadius: '5px',
                    marginTop: '4px',
                    marginBottom: '4px',
                  }}>
                    <img src="https://cdn0.iconfinder.com/data/icons/shift-interfaces/32/Error-512.png" style={{
                      paddingTop: '1px',
                      paddingRight: '4px',
                      width: '15px',
                    }} />
                    {passwordError}
                  </div>
                )}
              </Grid>
              <Grid item xs={12}>
                <TextField
                  style={tfStyle}
                  variant="filled"
                  required
                  fullWidth
                  name="confirmPassword"
                  label="Confirmar Contraseña"
                  type="password"
                  id="confirmPassword"
                  value={confirmPassword}
                  onChange={(e) => {
                    const value = e.target.value;
                    setConfirmPassword(value);
                    if (value === password) {
                      setConfirmPasswordError(''); // Borra el mensaje de error si la confirmación coincide con la contraseña
                    } else {
                      setConfirmPasswordError('Las contraseñas no coinciden');
                    }
                  }}
                />
                {confirmPasswordError && (
                  <div style={{
                    textAlign: 'left',
                    color: '#f2a4a4',
                    fontSize: '15px',
                    fontWeight: 'normal',
                    borderRadius: '5px',
                    marginTop: '4px',
                    marginBottom: '4px',
                  }}>
                    <img src="https://cdn0.iconfinder.com/data/icons/shift-interfaces/32/Error-512.png" style={{
                      paddingTop: '1px',
                      paddingRight: '4px',
                      width: '15px',
                    }} />
                    {confirmPasswordError}
                  </div>
                )}
              </Grid>
              <Grid item xs={12}>
                <TextField
                  style={tfStyle}
                  variant="filled"
                  fullWidth
                  id="phone"
                  label="Número de Teléfono"
                  onChange={(e) => {
                    const value = e.target.value;
                    setPhone(value);
                    if (phoneRegex.test(value)) {
                      setPhoneError(''); // Clear the error message
                    }
                  }}
                  name="phone"
                />
                {phoneError && (
                  <div style={{
                    textAlign: 'left',
                    color: '#f2a4a4',
                    fontSize: '15px',
                    fontWeight: 'normal',
                    borderRadius: '5px',
                    marginTop: '4px',
                    marginBottom: '4px',
                  }}>
                    <img src="https://cdn0.iconfinder.com/data/icons/shift-interfaces/32/Error-512.png" style={{
                      paddingTop: '1px',
                      paddingRight: '4px',
                      width: '15px',
                    }} />
                    {phoneError}
                  </div>
                )}
              </Grid>

              <Grid item xs={12}>
                <Textfield
                  style={tfStyle}
                  variant="filled"
                  type="date"
                  fullWidth
                  id="birthday"
                  label="Fecha de Nacimiento"
                  InputLabelProps={{
                    shrink: true,
                  }}
                  name="birthday"
                  value={birthday}
                  onChange={handleDateChange}
                />
                {isSubmitting && birthdayError && (
                  <div style={{
                    textAlign: 'left',
                    color: '#f2a4a4',
                    fontSize: '15px',
                    fontWeight: 'normal',
                    borderRadius: '5px',
                    marginTop: '4px',
                    marginBottom: '4px',
                  }}>
                    <img src="https://cdn0.iconfinder.com/data/icons/shift-interfaces/32/Error-512.png" style={{
                      paddingTop: '1px',
                      paddingRight: '4px',
                      width: '15px',
                    }} />
                    {birthdayError}
                  </div>
                )}
              </Grid>
              <Grid item xs={12}>
                <FormControl variant="filled" fullWidth style={tfStyle}>
                  <InputLabel id="gender-label">Género</InputLabel>
                  <Select
                    labelId="gender-label"
                    id="gender"
                    value={gender}
                    label="Género"
                    onChange={handleGenderChange}
                  >
                    <MenuItem value="No especificado">No especificar</MenuItem>
                    <MenuItem value="Masculino">Masculino</MenuItem>
                    <MenuItem value="Femenino">Femenino</MenuItem>
                  </Select>
                </FormControl>
                {isSubmitting && !gender && (
                  <div style={{
                    textAlign: 'left',
                    color: '#f2a4a4',
                    fontSize: '15px',
                    fontWeight: 'normal',
                    borderRadius: '5px',
                    marginTop: '4px',
                    marginBottom: '4px',
                  }}>
                    <img src="https://cdn0.iconfinder.com/data/icons/shift-interfaces/32/Error-512.png" style={{
                      paddingTop: '1px',
                      paddingRight: '4px',
                      width: '15px',
                    }} />
                    {genderError}
                  </div>
                )}
              </Grid>
              <Grid container spacing={2}>
                {/* Dropdown de Provincia */}
                <Grid item xs={4}>
                  <FormControl variant="filled" fullWidth style={tfStyle}>
                    <InputLabel id="province-label">Provincia</InputLabel>
                    <Select
                      labelId="province-label"
                      id="province"
                      value={province}
                      label="Provincia"
                      onChange={handleProvinceChange}
                    >
                      <MenuItem value="">Seleccionar provincia</MenuItem>
                      {provinces.map((prov) => (
                        <MenuItem key={prov} value={prov}>
                          {prov}
                        </MenuItem>
                      ))}
                    </Select>
                  </FormControl>
                  {isSubmitting && !province && (
                    <div style={{
                      textAlign: 'left',
                      color: '#f2a4a4',
                      fontSize: '15px',
                      fontWeight: 'normal',
                      borderRadius: '5px',
                      marginTop: '4px',
                      marginBottom: '4px',
                    }}>
                      <img src="https://cdn0.iconfinder.com/data/icons/shift-interfaces/32/Error-512.png" style={{
                        paddingTop: '1px',
                        paddingRight: '4px',
                        width: '15px',
                      }} />
                      {provinceError}
                    </div>
                  )}
                </Grid>
                {/* Dropdown de Cantón */}
                <Grid item xs={4}>
                  <FormControl variant="filled" fullWidth style={tfStyle}>
                    <InputLabel id="canton-label">Cantón</InputLabel>
                    <Select
                      labelId="canton-label"
                      id="canton"
                      value={canton}
                      onChange={handleCantonChange}
                      label="Cantón"
                      disabled={!province} // Deshabilitar si no se ha seleccionado una provincia
                    >
                      <MenuItem value="">Seleccionar cantón</MenuItem>
                      {cantonOptions.map((can) => (
                        <MenuItem key={can} value={can}>
                          {can}
                        </MenuItem>
                      ))}
                    </Select>
                  </FormControl>
                  {isSubmitting && !canton && (
                    <div style={{
                      textAlign: 'left',
                      color: '#f2a4a4',
                      fontSize: '15px',
                      fontWeight: 'normal',
                      borderRadius: '5px',
                      marginTop: '4px',
                      marginBottom: '4px',
                    }}>
                      <img src="https://cdn0.iconfinder.com/data/icons/shift-interfaces/32/Error-512.png" style={{
                        paddingTop: '1px',
                        paddingRight: '4px',
                        width: '15px',
                      }} />
                      {cantonError}
                    </div>
                  )}
                </Grid>
                {/* Dropdown de Distrito */}
                <Grid item xs={4}>
                  <FormControl variant="filled" fullWidth style={tfStyle}>
                    <InputLabel id="distrit-label">Distrito</InputLabel>
                    <Select
                      labelId="distrit-label"
                      id="distrit"
                      value={distrit}
                      onChange={handledistritChange}
                      label="Distrito"
                      disabled={!canton} // Deshabilitar si no se ha seleccionado un cantón
                    >
                      <MenuItem value="">Seleccionar distrito</MenuItem>
                      {distritOptions.map((dist) => (
                        <MenuItem key={dist} value={dist}>
                          {dist}
                        </MenuItem>
                      ))}
                    </Select>
                  </FormControl>
                  {isSubmitting && !distrit && (
                    <div style={{
                      textAlign: 'left',
                      color: '#f2a4a4',
                      fontSize: '15px',
                      fontWeight: 'normal',
                      borderRadius: '5px',
                      marginTop: '4px',
                      marginBottom: '4px',
                    }}>
                      <img src="https://cdn0.iconfinder.com/data/icons/shift-interfaces/32/Error-512.png" style={{
                        paddingTop: '1px',
                        paddingRight: '4px',
                        width: '15px',
                      }} />
                      {distritError}
                    </div>
                  )}
                </Grid>
              </Grid>
              {/* Fin de los nuevos campos */}

            </Grid>
            {/* {error && <div className={styles.error_msg}>{error}</div>} */}
            <Button
              onClick={handleSubmit}
              type="submit"
              fullWidth
              variant="contained"
              color="primary"
              className={classes.submit}
            >
              Registrarse
            </Button>
            <Grid container justifyContent="flex-end">
              <Grid item>
                <Link href="/SignIn/signIn" variant="body2" style={txtWhite}>
                  ¿Ya tiene una cuenta? Inicia Sesión
                </Link>
              </Grid>
            </Grid>
          </form>
        </div>
        <Box mt={6}></Box>
      </Container>
    </div>
  );
}

export default CreateFile;
